import React from 'react'

import './Menu.css';


function Menu(props) {
    //props.onClickNav();
    //여기서 STATE를 만들고
    const {CheckMenu, Address, Content} = props;

    return (
        <button onClick = {() => CheckMenu(Content)}>
            <a href={Address}>
                <div>
                    {Content}
                    {Console.log("Content")}
                </div>
            </a>
        </button>
    )
}

export default Menu
